config.extendOutputFunction:
async ({ data, item, itemSpec, page, request, customData, Apify }) => {
  // Get follower count - handle both nested and flattened structures
  const followerCount = item.authorMeta?.fans || item['authorMeta.fans'] || 0;

  // Filter by minimum followers (5000)
  if (followerCount < 5000) {
    return null;
  }

  // Get bio - handle both nested and flattened structures
  const bio = (item.authorMeta?.signature || item['authorMeta.signature'] || '').toLowerCase();
  const keywords = ['ai', 'tech', 'career', 'recruiter', 'recruiting'];
  const hasBioKeyword = keywords.some(keyword => bio.includes(keyword));

  // Only return profiles that have keywords in bio AND have 5000+ fans
  if (hasBioKeyword) {
    return item;
  }
  return null;
}
